        // Arguments    : creal_T y[2048]
        //                const creal_T reconVar1[1024]
        //                const creal_T reconVar2[1024]
        //                const int wrapIndex[1024]
        // Return Type  : void
        //
        void FFTImplementationCallback::b_getback_radix2_fft(creal_T y[2048],
            const creal_T reconVar1[1024], const creal_T reconVar2[1024], const
            int wrapIndex[1024])
        {
            double d;
            double temp1_im;
            double temp1_re;
            double temp2_im;
            double temp2_re_tmp;
            double y_im;
            double y_im_tmp;
            temp2_im = y[0].re;
            temp1_im = y[0].im;
            y_im = y[0].re * reconVar1[0].im + y[0].im * reconVar1[0].re;
            y_im_tmp = -y[0].im;
            temp2_re_tmp = temp2_im * reconVar2[0].re;
            y[0].re = 0.5 * ((y[0].re * reconVar1[0].re - y[0].im * reconVar1[0]
                              .im) + (temp2_re_tmp - y_im_tmp * reconVar2[0].im));
            d = temp2_im * reconVar2[0].im;
            y[0].im = 0.5 * (y_im + (d + y_im_tmp * reconVar2[0].re));
            y[1024].re = 0.5 * ((temp2_re_tmp - temp1_im * reconVar2[0].im) +
                                (temp2_im * reconVar1[0].re - -temp1_im *
                                 reconVar1[0].im));
            y[1024].im = 0.5 * ((d + temp1_im * reconVar2[0].re) + (temp2_im *
                                 reconVar1[0].im + -temp1_im * reconVar1[0].re));
            for (int i = 0; i < 511; i++) {
                int temp2_re_tmp_tmp;
                temp1_re = y[i + 1].re;
                temp1_im = y[i + 1].im;
                temp2_re_tmp_tmp = wrapIndex[i + 1];
                temp2_re_tmp = y[temp2_re_tmp_tmp - 1].re;
                temp2_im = y[temp2_re_tmp_tmp - 1].im;
                y_im = y[i + 1].re * reconVar1[i + 1].im + y[i + 1].im *
                    reconVar1[i + 1].re;
                y_im_tmp = -y[temp2_re_tmp_tmp - 1].im;
                y[i + 1].re = 0.5 * ((y[i + 1].re * reconVar1[i + 1].re - y[i +
                                      1].im * reconVar1[i + 1].im) +
                                     (temp2_re_tmp * reconVar2[i + 1].re -
                                      y_im_tmp * reconVar2[i + 1].im));
                y[i + 1].im = 0.5 * (y_im + (temp2_re_tmp * reconVar2[i + 1].im
                                      + y_im_tmp * reconVar2[i + 1].re));
                y[i + 1025].re = 0.5 * ((temp1_re * reconVar2[i + 1].re -
                    temp1_im * reconVar2[i + 1].im) + (temp2_re_tmp *
                    reconVar1[i + 1].re - -temp2_im * reconVar1[i + 1].im));
                y[i + 1025].im = 0.5 * ((temp1_re * reconVar2[i + 1].im +
                    temp1_im * reconVar2[i + 1].re) + (temp2_re_tmp *
                    reconVar1[i + 1].im + -temp2_im * reconVar1[i + 1].re));
                y[temp2_re_tmp_tmp - 1].re = 0.5 * ((temp2_re_tmp *
                    reconVar1[temp2_re_tmp_tmp - 1].re - temp2_im *
                    reconVar1[temp2_re_tmp_tmp - 1].im) + (temp1_re *
                    reconVar2[temp2_re_tmp_tmp - 1].re - -temp1_im *
                    reconVar2[temp2_re_tmp_tmp - 1].im));
                y[temp2_re_tmp_tmp - 1].im = 0.5 * ((temp2_re_tmp *
                    reconVar1[temp2_re_tmp_tmp - 1].im + temp2_im *
                    reconVar1[temp2_re_tmp_tmp - 1].re) + (temp1_re *
                    reconVar2[temp2_re_tmp_tmp - 1].im + -temp1_im *
                    reconVar2[temp2_re_tmp_tmp - 1].re));
                y[temp2_re_tmp_tmp + 1023].re = 0.5 * ((temp2_re_tmp *
                    reconVar2[temp2_re_tmp_tmp - 1].re - temp2_im *
                    reconVar2[temp2_re_tmp_tmp - 1].im) + (temp1_re *
                    reconVar1[temp2_re_tmp_tmp - 1].re - -temp1_im *
                    reconVar1[temp2_re_tmp_tmp - 1].im));
                y[temp2_re_tmp_tmp + 1023].im = 0.5 * ((temp2_re_tmp *
                    reconVar2[temp2_re_tmp_tmp - 1].im + temp2_im *
                    reconVar2[temp2_re_tmp_tmp - 1].re) + (temp1_re *
                    reconVar1[temp2_re_tmp_tmp - 1].im + -temp1_im *
                    reconVar1[temp2_re_tmp_tmp - 1].re));
            }

            temp2_im = y[512].re;
            temp1_im = y[512].im;
            y_im = y[512].re * reconVar1[512].im + y[512].im * reconVar1[512].re;
            temp1_re = -y[512].im;
            temp2_re_tmp = temp2_im * reconVar2[512].re;
            y[512].re = 0.5 * ((y[512].re * reconVar1[512].re - y[512].im *
                                reconVar1[512].im) + (temp2_re_tmp - temp1_re *
                                reconVar2[512].im));
            d = temp2_im * reconVar2[512].im;
            y[512].im = 0.5 * (y_im + (d + temp1_re * reconVar2[512].re));
            y[1536].re = 0.5 * ((temp2_re_tmp - temp1_im * reconVar2[512].im) +
                                (temp2_im * reconVar1[512].re - -temp1_im *
                                 reconVar1[512].im));
            y[1536].im = 0.5 * ((d + temp1_im * reconVar2[512].re) + (temp2_im *
                                 reconVar1[512].im + -temp1_im * reconVar1[512].
                                 re));
        }

        //
        // Arguments    : const creal_T x[1024]
        //                const double costab[512]
        //                const double sintab[512]
        //                creal_T y[1024]
        // Return Type  : void
        //
        void FFTImplementationCallback::b_r2br_r2dit_trig(const creal_T x[1024],
            const double costab[512], const double sintab[512], creal_T y[1024])
        {
            double temp_im;
            double temp_re;
            double twid_im;
            double twid_re;
            int i;
            int iheight;
            int iy;
            int ju;
            int k;
            iy = 0;
            ju = 0;
            for (i = 0; i < 1023; i++) {
                boolean_T tst;
                y[iy] = x[i];
                iy = 1024;
                tst = true;
                while (tst) {
                    iy >>= 1;
                    ju ^= iy;
                    tst = ((ju & iy) == 0);
                }

                iy = ju;
            }

            y[iy] = x[1023];
            for (i = 0; i <= 1022; i += 2) {
                double im;
                double re;
                twid_re = y[i + 1].re;
                temp_re = twid_re;
                twid_im = y[i + 1].im;
                temp_im = twid_im;
                re = y[i].re;
                im = y[i].im;
                twid_re = re - twid_re;
                y[i + 1].re = twid_re;
                twid_im = im - twid_im;
                y[i + 1].im = twid_im;
                y[i].re = re + temp_re;
                y[i].im = im + temp_im;
            }

            iy = 2;
            ju = 4;
            k = 256;
            iheight = 1021;
            while (k > 0) {
                int istart;
                int temp_re_tmp;
                for (i = 0; i < iheight; i += ju) {
                    temp_re_tmp = i + iy;
                    temp_re = y[temp_re_tmp].re;
                    temp_im = y[temp_re_tmp].im;
                    y[temp_re_tmp].re = y[i].re - temp_re;
                    y[temp_re_tmp].im = y[i].im - temp_im;
                    y[i].re += temp_re;
                    y[i].im += temp_im;
                }

                istart = 1;
                for (int j = k; j < 512; j += k) {
                    int ihi;
                    twid_re = costab[j];
                    twid_im = sintab[j];
                    i = istart;
                    ihi = istart + iheight;
                    while (i < ihi) {
                        temp_re_tmp = i + iy;
                        temp_re = twid_re * y[temp_re_tmp].re - twid_im *
                            y[temp_re_tmp].im;
                        temp_im = twid_re * y[temp_re_tmp].im + twid_im *
                            y[temp_re_tmp].re;
                        y[temp_re_tmp].re = y[i].re - temp_re;
                        y[temp_re_tmp].im = y[i].im - temp_im;
                        y[i].re += temp_re;
                        y[i].im += temp_im;
                        i += ju;
                    }

                    istart++;
                }

                k /= 2;
                iy = ju;
                ju += ju;
                iheight -= iy;
            }

            for (iy = 0; iy < 1024; iy++) {
                y[iy].re *= 0.0009765625;
                y[iy].im *= 0.0009765625;
            }
        }

