        //
        // Arguments    : int bitrevIndex[4096]
        // Return Type  : void
        //
        void FFTImplementationCallback::get_bitrevIndex(int bitrevIndex[4096])
        {
            int iy;
            int ju;
            ju = 0;
            iy = 1;
            for (int b_j1 = 0; b_j1 < 4095; b_j1++) {
                boolean_T tst;
                bitrevIndex[b_j1] = iy;
                iy = 4096;
                tst = true;
                while (tst) {
                    iy >>= 1;
                    ju ^= iy;
                    tst = ((ju & iy) == 0);
                }

                iy = ju + 1;
            }

            bitrevIndex[4095] = iy;
        }

        //
        // Arguments    : int nRowsM1
        //                int nfftLen
        //                ::coder::array<int, 1U> &bitrevIndex
        // Return Type  : void
        //
        void FFTImplementationCallback::get_bitrevIndex(int nRowsM1, int nfftLen,
            ::coder::array<int, 1U> &bitrevIndex)
        {
            int b_j1;
            int iy;
            int ju;
            ju = 0;
            iy = 1;
            bitrevIndex.set_size(nfftLen);
            for (b_j1 = 0; b_j1 < nfftLen; b_j1++) {
                bitrevIndex[b_j1] = 0;
            }

            for (b_j1 = 0; b_j1 < nRowsM1; b_j1++) {
                boolean_T tst;
                bitrevIndex[b_j1] = iy;
                iy = nfftLen;
                tst = true;
                while (tst) {
                    iy >>= 1;
                    ju ^= iy;
                    tst = ((ju & iy) == 0);
                }

                iy = ju + 1;
            }

            bitrevIndex[nRowsM1] = iy;
        }

