        //
        // Arguments    : creal_T y[1024]
        //                const creal_T reconVar1[512]
        //                const creal_T reconVar2[512]
        //                const int wrapIndex[512]
        // Return Type  : void
        //
        void FFTImplementationCallback::getback_radix2_fft(creal_T y[1024],
            const creal_T reconVar1[512], const creal_T reconVar2[512], const
            int wrapIndex[512])
        {
            double d;
            double temp1_im;
            double temp1_re;
            double temp2_im;
            double temp2_re_tmp;
            double y_im;
            double y_im_tmp;
            temp2_im = y[0].re;
            temp1_im = y[0].im;
            y_im = y[0].re * reconVar1[0].im + y[0].im * reconVar1[0].re;
            y_im_tmp = -y[0].im;
            temp2_re_tmp = temp2_im * reconVar2[0].re;
            y[0].re = 0.5 * ((y[0].re * reconVar1[0].re - y[0].im * reconVar1[0]
                              .im) + (temp2_re_tmp - y_im_tmp * reconVar2[0].im));
            d = temp2_im * reconVar2[0].im;
            y[0].im = 0.5 * (y_im + (d + y_im_tmp * reconVar2[0].re));
            y[512].re = 0.5 * ((temp2_re_tmp - temp1_im * reconVar2[0].im) +
                               (temp2_im * reconVar1[0].re - -temp1_im *
                                reconVar1[0].im));
            y[512].im = 0.5 * ((d + temp1_im * reconVar2[0].re) + (temp2_im *
                                reconVar1[0].im + -temp1_im * reconVar1[0].re));
            for (int i = 0; i < 255; i++) {
                int temp2_re_tmp_tmp;
                temp1_re = y[i + 1].re;
                temp1_im = y[i + 1].im;
                temp2_re_tmp_tmp = wrapIndex[i + 1];
                temp2_re_tmp = y[temp2_re_tmp_tmp - 1].re;
                temp2_im = y[temp2_re_tmp_tmp - 1].im;
                y_im = y[i + 1].re * reconVar1[i + 1].im + y[i + 1].im *
                    reconVar1[i + 1].re;
                y_im_tmp = -y[temp2_re_tmp_tmp - 1].im;
                y[i + 1].re = 0.5 * ((y[i + 1].re * reconVar1[i + 1].re - y[i +
                                      1].im * reconVar1[i + 1].im) +
                                     (temp2_re_tmp * reconVar2[i + 1].re -
                                      y_im_tmp * reconVar2[i + 1].im));
                y[i + 1].im = 0.5 * (y_im + (temp2_re_tmp * reconVar2[i + 1].im
                                      + y_im_tmp * reconVar2[i + 1].re));
                y[i + 513].re = 0.5 * ((temp1_re * reconVar2[i + 1].re -
                                        temp1_im * reconVar2[i + 1].im) +
                                       (temp2_re_tmp * reconVar1[i + 1].re -
                                        -temp2_im * reconVar1[i + 1].im));
                y[i + 513].im = 0.5 * ((temp1_re * reconVar2[i + 1].im +
                                        temp1_im * reconVar2[i + 1].re) +
                                       (temp2_re_tmp * reconVar1[i + 1].im +
                                        -temp2_im * reconVar1[i + 1].re));
                y[temp2_re_tmp_tmp - 1].re = 0.5 * ((temp2_re_tmp *
                    reconVar1[temp2_re_tmp_tmp - 1].re - temp2_im *
                    reconVar1[temp2_re_tmp_tmp - 1].im) + (temp1_re *
                    reconVar2[temp2_re_tmp_tmp - 1].re - -temp1_im *
                    reconVar2[temp2_re_tmp_tmp - 1].im));
                y[temp2_re_tmp_tmp - 1].im = 0.5 * ((temp2_re_tmp *
                    reconVar1[temp2_re_tmp_tmp - 1].im + temp2_im *
                    reconVar1[temp2_re_tmp_tmp - 1].re) + (temp1_re *
                    reconVar2[temp2_re_tmp_tmp - 1].im + -temp1_im *
                    reconVar2[temp2_re_tmp_tmp - 1].re));
                y[temp2_re_tmp_tmp + 511].re = 0.5 * ((temp2_re_tmp *
                    reconVar2[temp2_re_tmp_tmp - 1].re - temp2_im *
                    reconVar2[temp2_re_tmp_tmp - 1].im) + (temp1_re *
                    reconVar1[temp2_re_tmp_tmp - 1].re - -temp1_im *
                    reconVar1[temp2_re_tmp_tmp - 1].im));
                y[temp2_re_tmp_tmp + 511].im = 0.5 * ((temp2_re_tmp *
                    reconVar2[temp2_re_tmp_tmp - 1].im + temp2_im *
                    reconVar2[temp2_re_tmp_tmp - 1].re) + (temp1_re *
                    reconVar1[temp2_re_tmp_tmp - 1].im + -temp1_im *
                    reconVar1[temp2_re_tmp_tmp - 1].re));
            }

            temp2_im = y[256].re;
            temp1_im = y[256].im;
            y_im = y[256].re * reconVar1[256].im + y[256].im * reconVar1[256].re;
            temp1_re = -y[256].im;
            temp2_re_tmp = temp2_im * reconVar2[256].re;
            y[256].re = 0.5 * ((y[256].re * reconVar1[256].re - y[256].im *
                                reconVar1[256].im) + (temp2_re_tmp - temp1_re *
                                reconVar2[256].im));
            d = temp2_im * reconVar2[256].im;
            y[256].im = 0.5 * (y_im + (d + temp1_re * reconVar2[256].re));
            y[768].re = 0.5 * ((temp2_re_tmp - temp1_im * reconVar2[256].im) +
                               (temp2_im * reconVar1[256].re - -temp1_im *
                                reconVar1[256].im));
            y[768].im = 0.5 * ((d + temp1_im * reconVar2[256].re) + (temp2_im *
                                reconVar1[256].im + -temp1_im * reconVar1[256].
                                re));
        }

        //
        // Arguments    : ::coder::array<creal_T, 1U> &y
        //                const ::coder::array<creal_T, 1U> &reconVar1
        //                const ::coder::array<creal_T, 1U> &reconVar2
        //                const ::coder::array<int, 2U> &wrapIndex
        //                int hnRows
        // Return Type  : void
        //
        void FFTImplementationCallback::getback_radix2_fft(::coder::array<
            creal_T, 1U> &y, const ::coder::array<creal_T, 1U> &reconVar1, const
            ::coder::array<creal_T, 1U> &reconVar2, const ::coder::array<int, 2U>
            &wrapIndex, int hnRows)
        {
            double temp1_im;
            double temp1_re;
            double y_im;
            double y_im_tmp;
            int b_i;
            int iterVar;
            iterVar = hnRows / 2;
            temp1_re = y[0].re;
            temp1_im = y[0].im;
            y_im = y[0].re * reconVar1[0].im + y[0].im * reconVar1[0].re;
            y_im_tmp = -y[0].im;
            y[0].re = 0.5 * ((y[0].re * reconVar1[0].re - y[0].im * reconVar1[0]
                              .im) + (temp1_re * reconVar2[0].re - y_im_tmp *
                              reconVar2[0].im));
            y[0].im = 0.5 * (y_im + (temp1_re * reconVar2[0].im + y_im_tmp *
                              reconVar2[0].re));
            y[hnRows].re = 0.5 * ((temp1_re * reconVar2[0].re - temp1_im *
                                   reconVar2[0].im) + (temp1_re * reconVar1[0].
                                   re - -temp1_im * reconVar1[0].im));
            y[hnRows].im = 0.5 * ((temp1_re * reconVar2[0].im + temp1_im *
                                   reconVar2[0].re) + (temp1_re * reconVar1[0].
                                   im + -temp1_im * reconVar1[0].re));
            for (int i = 2; i <= iterVar; i++) {
                double temp2_im;
                double temp2_re_tmp;
                int i1;
                temp1_re = y[i - 1].re;
                temp1_im = y[i - 1].im;
                b_i = wrapIndex[i - 1];
                temp2_re_tmp = y[b_i - 1].re;
                temp2_im = y[b_i - 1].im;
                y_im = y[i - 1].re * reconVar1[i - 1].im + y[i - 1].im *
                    reconVar1[i - 1].re;
                y_im_tmp = -y[b_i - 1].im;
                y[i - 1].re = 0.5 * ((y[i - 1].re * reconVar1[i - 1].re - y[i -
                                      1].im * reconVar1[i - 1].im) +
                                     (temp2_re_tmp * reconVar2[i - 1].re -
                                      y_im_tmp * reconVar2[i - 1].im));
                y[i - 1].im = 0.5 * (y_im + (temp2_re_tmp * reconVar2[i - 1].im
                                      + y_im_tmp * reconVar2[i - 1].re));
                i1 = (hnRows + i) - 1;
                y[i1].re = 0.5 * ((temp1_re * reconVar2[i - 1].re - temp1_im *
                                   reconVar2[i - 1].im) + (temp2_re_tmp *
                                   reconVar1[i - 1].re - -temp2_im * reconVar1[i
                                   - 1].im));
                y[i1].im = 0.5 * ((temp1_re * reconVar2[i - 1].im + temp1_im *
                                   reconVar2[i - 1].re) + (temp2_re_tmp *
                                   reconVar1[i - 1].im + -temp2_im * reconVar1[i
                                   - 1].re));
                y[b_i - 1].re = 0.5 * ((temp2_re_tmp * reconVar1[b_i - 1].re -
                                        temp2_im * reconVar1[b_i - 1].im) +
                                       (temp1_re * reconVar2[b_i - 1].re -
                                        -temp1_im * reconVar2[b_i - 1].im));
                y[b_i - 1].im = 0.5 * ((temp2_re_tmp * reconVar1[b_i - 1].im +
                                        temp2_im * reconVar1[b_i - 1].re) +
                                       (temp1_re * reconVar2[b_i - 1].im +
                                        -temp1_im * reconVar2[b_i - 1].re));
                i1 = (b_i + hnRows) - 1;
                y[i1].re = 0.5 * ((temp2_re_tmp * reconVar2[b_i - 1].re -
                                   temp2_im * reconVar2[b_i - 1].im) + (temp1_re
                                   * reconVar1[b_i - 1].re - -temp1_im *
                                   reconVar1[b_i - 1].im));
                y[i1].im = 0.5 * ((temp2_re_tmp * reconVar2[b_i - 1].im +
                                   temp2_im * reconVar2[b_i - 1].re) + (temp1_re
                                   * reconVar1[b_i - 1].im + -temp1_im *
                                   reconVar1[b_i - 1].re));
            }

            if (iterVar != 0) {
                temp1_re = y[iterVar].re;
                temp1_im = y[iterVar].im;
                y_im = y[iterVar].re * reconVar1[iterVar].im + y[iterVar].im *
                    reconVar1[iterVar].re;
                y_im_tmp = -y[iterVar].im;
                y[iterVar].re = 0.5 * ((y[iterVar].re * reconVar1[iterVar].re -
                                        y[iterVar].im * reconVar1[iterVar].im) +
                                       (temp1_re * reconVar2[iterVar].re -
                                        y_im_tmp * reconVar2[iterVar].im));
                y[iterVar].im = 0.5 * (y_im + (temp1_re * reconVar2[iterVar].im
                                        + y_im_tmp * reconVar2[iterVar].re));
                b_i = hnRows + iterVar;
                y[b_i].re = 0.5 * ((temp1_re * reconVar2[iterVar].re - temp1_im *
                                    reconVar2[iterVar].im) + (temp1_re *
                                    reconVar1[iterVar].re - -temp1_im *
                                    reconVar1[iterVar].im));
                y[b_i].im = 0.5 * ((temp1_re * reconVar2[iterVar].im + temp1_im *
                                    reconVar2[iterVar].re) + (temp1_re *
                                    reconVar1[iterVar].im + -temp1_im *
                                    reconVar1[iterVar].re));
            }
        }

        //
        // Arguments    : const creal_T x[256]
        //                const double costab[128]
        //                const double sintab[128]
        //                creal_T y[256]
        // Return Type  : void
        //
        void FFTImplementationCallback::r2br_r2dit_trig(const creal_T x[256],
            const double costab[128], const double sintab[128], creal_T y[256])
        {
            double temp_im;
            double temp_re;
            double twid_im;
            double twid_re;
            int i;
            int iheight;
            int iy;
            int ju;
            int k;
            iy = 0;
            ju = 0;
            for (i = 0; i < 255; i++) {
                boolean_T tst;
                y[iy] = x[i];
                iy = 256;
                tst = true;
                while (tst) {
                    iy >>= 1;
                    ju ^= iy;
                    tst = ((ju & iy) == 0);
                }

                iy = ju;
            }

            y[iy] = x[255];
            for (i = 0; i <= 254; i += 2) {
                double im;
                double re;
                twid_re = y[i + 1].re;
                temp_re = twid_re;
                twid_im = y[i + 1].im;
                temp_im = twid_im;
                re = y[i].re;
                im = y[i].im;
                twid_re = re - twid_re;
                y[i + 1].re = twid_re;
                twid_im = im - twid_im;
                y[i + 1].im = twid_im;
                y[i].re = re + temp_re;
                y[i].im = im + temp_im;
            }

            iy = 2;
            ju = 4;
            k = 64;
            iheight = 253;
            while (k > 0) {
                int istart;
                int temp_re_tmp;
                for (i = 0; i < iheight; i += ju) {
                    temp_re_tmp = i + iy;
                    temp_re = y[temp_re_tmp].re;
                    temp_im = y[temp_re_tmp].im;
                    y[temp_re_tmp].re = y[i].re - temp_re;
                    y[temp_re_tmp].im = y[i].im - temp_im;
                    y[i].re += temp_re;
                    y[i].im += temp_im;
                }

                istart = 1;
                for (int j = k; j < 128; j += k) {
                    int ihi;
                    twid_re = costab[j];
                    twid_im = sintab[j];
                    i = istart;
                    ihi = istart + iheight;
                    while (i < ihi) {
                        temp_re_tmp = i + iy;
                        temp_re = twid_re * y[temp_re_tmp].re - twid_im *
                            y[temp_re_tmp].im;
                        temp_im = twid_re * y[temp_re_tmp].im + twid_im *
                            y[temp_re_tmp].re;
                        y[temp_re_tmp].re = y[i].re - temp_re;
                        y[temp_re_tmp].im = y[i].im - temp_im;
                        y[i].re += temp_re;
                        y[i].im += temp_im;
                        i += ju;
                    }

                    istart++;
                }

                k /= 2;
                iy = ju;
                ju += ju;
                iheight -= iy;
            }

            for (iy = 0; iy < 256; iy++) {
                y[iy].re *= 0.00390625;
                y[iy].im *= 0.00390625;
            }
        }

        //
        // Arguments    : const ::coder::array<double, 2U> &x
        //                int xoffInit
        //                ::coder::array<creal_T, 1U> &y
        //                int nrowsx
        //                int nRows
        //                int nfft
        //                const ::coder::array<creal_T, 1U> &wwc
        //                const ::coder::array<double, 2U> &costab
        //                const ::coder::array<double, 2U> &sintab
        //                const ::coder::array<double, 2U> &costabinv
        //                const ::coder::array<double, 2U> &sintabinv
        // Return Type  : void
        //
        void FFTImplementationCallback::b_doHalfLengthBluestein(const ::coder::
            array<double, 2U> &x, int xoffInit, ::coder::array<creal_T, 1U> &y,
            int nrowsx, int nRows, int nfft, const ::coder::array<creal_T, 1U>
            &wwc, const ::coder::array<double, 2U> &costab, const ::coder::array<
            double, 2U> &sintab, const ::coder::array<double, 2U> &costabinv,
            const ::coder::array<double, 2U> &sintabinv)
        {
            array<creal_T, 1U> b_fv;
            array<creal_T, 1U> fv;
            array<creal_T, 1U> reconVar1;
            array<creal_T, 1U> reconVar2;
            array<creal_T, 1U> ytmp;
            array<double, 2U> a__1;
            array<double, 2U> costable;
            array<double, 2U> hcostabinv;
            array<double, 2U> hsintab;
            array<double, 2U> hsintabinv;
            array<double, 2U> sintable;
            array<int, 2U> wrapIndex;
            double a_im;
            double a_re;
            double b_re;
            double z_tmp;
            int b_i;
            int hnRows;
            int i;
            int k;
            int minHnrowsNx;
            boolean_T nxeven;
            hnRows = nRows / 2;
            ytmp.set_size(hnRows);
            if (hnRows > nrowsx) {
                ytmp.set_size(hnRows);
                for (i = 0; i < hnRows; i++) {
                    ytmp[i].re = 0.0;
                    ytmp[i].im = 0.0;
                }
            }

            if ((x.size(0) & 1) == 0) {
                nxeven = true;
                minHnrowsNx = x.size(0);
            } else if (x.size(0) >= nRows) {
                nxeven = true;
                minHnrowsNx = nRows;
            } else {
                nxeven = false;
                minHnrowsNx = x.size(0) - 1;
            }

            if (minHnrowsNx >= nRows) {
                minHnrowsNx = nRows;
            }

            FFTImplementationCallback::b_generate_twiddle_tables(nRows << 1,
                costable, sintable, a__1);
            FFTImplementationCallback::get_half_twiddle_tables(costab, sintab,
                costabinv, sintabinv, a__1, hsintab, hcostabinv, hsintabinv);
            reconVar1.set_size(hnRows);
            reconVar2.set_size(hnRows);
            wrapIndex.set_size(1, hnRows);
            for (b_i = 0; b_i < hnRows; b_i++) {
                i = b_i << 1;
                z_tmp = sintable[i];
                a_re = costable[i];
                reconVar1[b_i].re = 1.0 - z_tmp;
                reconVar1[b_i].im = -a_re;
                reconVar2[b_i].re = z_tmp + 1.0;
                reconVar2[b_i].im = a_re;
                if (b_i + 1 != 1) {
                    wrapIndex[b_i] = (hnRows - b_i) + 1;
                } else {
                    wrapIndex[0] = 1;
                }
            }

            z_tmp = static_cast<double>(minHnrowsNx) / 2.0;
            i = static_cast<int>(z_tmp);
            for (int k1 = 0; k1 < i; k1++) {
                double b_im;
                b_i = (hnRows + k1) - 1;
                a_re = wwc[b_i].re;
                a_im = wwc[b_i].im;
                k = xoffInit + (k1 << 1);
                b_re = x[k];
                b_im = x[k + 1];
                ytmp[k1].re = a_re * b_re + a_im * b_im;
                ytmp[k1].im = a_re * b_im - a_im * b_re;
            }

            if (!nxeven) {
                b_i = (hnRows + static_cast<int>(z_tmp)) - 1;
                a_re = wwc[b_i].re;
                a_im = wwc[b_i].im;
                b_re = x[xoffInit + (static_cast<int>(z_tmp) << 1)];
                ytmp[static_cast<int>(z_tmp)].re = a_re * b_re + a_im * 0.0;
                ytmp[static_cast<int>(z_tmp)].im = a_re * 0.0 - a_im * b_re;
                if (static_cast<int>(z_tmp) + 2 <= hnRows) {
                    i = static_cast<int>(static_cast<double>(minHnrowsNx) / 2.0)
                        + 2;
                    for (b_i = i; b_i <= hnRows; b_i++) {
                        ytmp[b_i - 1].re = 0.0;
                        ytmp[b_i - 1].im = 0.0;
                    }
                }
            } else if (static_cast<int>(z_tmp) + 1 <= hnRows) {
                i = static_cast<int>(static_cast<double>(minHnrowsNx) / 2.0) + 1;
                for (b_i = i; b_i <= hnRows; b_i++) {
                    ytmp[b_i - 1].re = 0.0;
                    ytmp[b_i - 1].im = 0.0;
                }
            }

            b_i = static_cast<int>(static_cast<double>(nfft) / 2.0);
            FFTImplementationCallback::r2br_r2dit_trig_impl(ytmp, b_i, a__1,
                hsintab, fv);
            FFTImplementationCallback::r2br_r2dit_trig_impl(wwc, b_i, a__1,
                hsintab, b_fv);
            b_fv.set_size(fv.size(0));
            k = fv.size(0);
            for (i = 0; i < k; i++) {
                z_tmp = fv[i].re * b_fv[i].im + fv[i].im * b_fv[i].re;
                b_fv[i].re = fv[i].re * b_fv[i].re - fv[i].im * b_fv[i].im;
                b_fv[i].im = z_tmp;
            }

            FFTImplementationCallback::r2br_r2dit_trig_impl(b_fv, b_i,
                hcostabinv, hsintabinv, fv);
            if (fv.size(0) > 1) {
                z_tmp = 1.0 / static_cast<double>(fv.size(0));
                k = fv.size(0);
                for (i = 0; i < k; i++) {
                    fv[i].re = z_tmp * fv[i].re;
                    fv[i].im = z_tmp * fv[i].im;
                }
            }

            i = wwc.size(0);
            for (k = hnRows; k <= i; k++) {
                a_re = wwc[k - 1].re * fv[k - 1].re + wwc[k - 1].im * fv[k - 1].
                    im;
                z_tmp = wwc[k - 1].re * fv[k - 1].im - wwc[k - 1].im * fv[k - 1]
                    .re;
                if (z_tmp == 0.0) {
                    b_i = k - hnRows;
                    ytmp[b_i].re = a_re / static_cast<double>(hnRows);
                    ytmp[b_i].im = 0.0;
                } else if (a_re == 0.0) {
                    b_i = k - hnRows;
                    ytmp[b_i].re = 0.0;
                    ytmp[b_i].im = z_tmp / static_cast<double>(hnRows);
                } else {
                    b_i = k - hnRows;
                    ytmp[b_i].re = a_re / static_cast<double>(hnRows);
                    ytmp[b_i].im = z_tmp / static_cast<double>(hnRows);
                }
            }

            for (b_i = 0; b_i < hnRows; b_i++) {
                i = wrapIndex[b_i];
                z_tmp = ytmp[i - 1].re;
                a_re = -ytmp[i - 1].im;
                y[b_i].re = 0.5 * ((ytmp[b_i].re * reconVar1[b_i].re - ytmp[b_i]
                                    .im * reconVar1[b_i].im) + (z_tmp *
                                    reconVar2[b_i].re - a_re * reconVar2[b_i].im));
                y[b_i].im = 0.5 * ((ytmp[b_i].re * reconVar1[b_i].im + ytmp[b_i]
                                    .im * reconVar1[b_i].re) + (z_tmp *
                                    reconVar2[b_i].im + a_re * reconVar2[b_i].re));
                i = hnRows + b_i;
                y[i].re = 0.5 * ((ytmp[b_i].re * reconVar2[b_i].re - ytmp[b_i].
                                  im * reconVar2[b_i].im) + (z_tmp *
                                  reconVar1[b_i].re - a_re * reconVar1[b_i].im));
                y[i].im = 0.5 * ((ytmp[b_i].re * reconVar2[b_i].im + ytmp[b_i].
                                  im * reconVar2[b_i].re) + (z_tmp *
                                  reconVar1[b_i].im + a_re * reconVar1[b_i].re));
            }

            k = y.size(0);
            for (i = 0; i < k; i++) {
                a_re = y[i].re;
                z_tmp = y[i].im;
                if (z_tmp == 0.0) {
                    a_re /= 2.0;
                    z_tmp = 0.0;
                } else if (a_re == 0.0) {
                    a_re = 0.0;
                    z_tmp /= 2.0;
                } else {
                    a_re /= 2.0;
                    z_tmp /= 2.0;
                }

                y[i].re = a_re;
                y[i].im = z_tmp;
            }
        }

