        //
        // Arguments    : int nRows
        //                boolean_T useRadix2
        //                ::coder::array<double, 2U> &costab
        //                ::coder::array<double, 2U> &sintab
        //                ::coder::array<double, 2U> &sintabinv
        // Return Type  : void
        //
        void FFTImplementationCallback::c_generate_twiddle_tables(int nRows,
            boolean_T useRadix2, ::coder::array<double, 2U> &costab, ::coder::
            array<double, 2U> &sintab, ::coder::array<double, 2U> &sintabinv)
        {
            array<double, 2U> costab1q;
            double e;
            int i;
            int k;
            int n;
            int nd2;
            e = 6.2831853071795862 / static_cast<double>(nRows);
            n = nRows / 2 / 2;
            costab1q.set_size(1, n + 1);
            costab1q[0] = 1.0;
            nd2 = n / 2 - 1;
            for (k = 0; k <= nd2; k++) {
                costab1q[k + 1] = cos(e * (static_cast<double>(k) + 1.0));
            }

            i = nd2 + 2;
            nd2 = n - 1;
            for (k = i; k <= nd2; k++) {
                costab1q[k] = sin(e * static_cast<double>(n - k));
            }

            costab1q[n] = 0.0;
            if (!useRadix2) {
                n = costab1q.size(1) - 1;
                nd2 = (costab1q.size(1) - 1) << 1;
                costab.set_size(1, nd2 + 1);
                sintab.set_size(1, nd2 + 1);
                costab[0] = 1.0;
                sintab[0] = 0.0;
                sintabinv.set_size(1, nd2 + 1);
                for (k = 0; k < n; k++) {
                    sintabinv[k + 1] = costab1q[(n - k) - 1];
                }

                i = costab1q.size(1);
                for (k = i; k <= nd2; k++) {
                    sintabinv[k] = costab1q[k - n];
                }

                for (k = 0; k < n; k++) {
                    costab[k + 1] = costab1q[k + 1];
                    sintab[k + 1] = -costab1q[(n - k) - 1];
                }

                i = costab1q.size(1);
                for (k = i; k <= nd2; k++) {
                    costab[k] = -costab1q[nd2 - k];
                    sintab[k] = -costab1q[k - n];
                }
            } else {
                n = costab1q.size(1) - 1;
                nd2 = (costab1q.size(1) - 1) << 1;
                costab.set_size(1, nd2 + 1);
                sintab.set_size(1, nd2 + 1);
                costab[0] = 1.0;
                sintab[0] = 0.0;
                for (k = 0; k < n; k++) {
                    costab[k + 1] = costab1q[k + 1];
                    sintab[k + 1] = costab1q[(n - k) - 1];
                }

                i = costab1q.size(1);
                for (k = i; k <= nd2; k++) {
                    costab[k] = -costab1q[nd2 - k];
                    sintab[k] = costab1q[k - n];
                }

                sintabinv.set_size(1, 0);
            }
        }

